  {
    title: 'something2',
  },
  {
    title: 'something3',
  },
  {
    title: 'something4',
  }
]

class App extends React.Component {

  constructor(props) {
    super(props); 
  }

  render() {
    return (
      <div className="App">
        <header className="App-header"> TODO APP </header>
        <Input placeholder='Your Todo...' ></Input>
        <Button type="primary" />
        <List
          id='list-task'
          size='small'
          itemLayout='horizontal'
          dataSource={data}
          renderItem={(item, index) => (
              <List.Item>
                <Checkbox checked="true" />
                <span> 
                  {item.title} 
                </span>
              </List.Item>
          )}
        />

      </div>
    )  
  };
}

export default App;
